umi që është përdorur në kohën Osmane, por me ardhjen e Ataturkit në pushtet, ky kalendar është larguar nga përdorimi. Haxhi Selmani e ka prejardhjen nga Dibra dhe sipas te dhenave nga Bajram Selmani, Haxhi Selmani ishte nip prej fshatit Ivaje të Kosovës.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;strokeColor=none;fillColor=none;align=left;verticalAlign=middle;whiteSpace=wrap;rounded=0;container=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;-1306.88\&quot; y=\&quot;286.3854948283249\&quot; width=\&quot;556.88\&quot; height=\&quot;432.86\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;lYNshPUWYhIwK2SCOExY-25\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/png,iVBORw0KGgoAAAANSUhEUgAABLAAAANRCAYAAADznkVmAAAAAXNSR0IArs4c6QAAIABJREFUeF7s3XmQ5Od93/dP33dP99z3ufdiD1wEQBAkSFESGcuUFEeyK6lczl9xSuVEKZVkVclmFFKSSyVHEqVKVapUia3IrIgWZdmxJYEiIZIAQZy72Ht3dmd2du6Zvu+7U99nQJqyGNGSAKJhvgeFwuxipvvp1/N0T/8+832+j0d8IIAAAggggAACCCCAAAIIIIAAAgggMMACngEeG0NDAAEEEEAAAQQQQAABBBBAAAEEEEBABFgsAgQQQAABBBBAAAEEEEAAAQQQQACBgRYgwBro6WFwCCCAAAIIIIAAAggggAACCCCAAAIEWKwBBBBAAAEEEEAAAQQQQAABBBBAAIGBFiDAGujpYXAIIIAAAggggAACCCCAAAIIIIAAAgRYrAEEEEAAAQQQQAABBBBAAAEEEEAAgYEWIMAa6OlhcAgggAACCCCAAAIIIIAAAggggAACBFisAQQQQAABBBBAAAEEEEAAAQQQQACBgRYgwBro6WFwCCCAAAIIIIAAAggggAACCCCAAAIEWKwBBBBAAAEEEEAAAQQQQAABBBBAAIGBFiDAGujpYXAIIIAAAggggAACCCCAAAIIIIAAAgRYrAEEEEAAAQQQQAABBBBAAAEEEEAAgYEWIMAa6OlhcAgggAACCCCAAAIIIIAAAggggAACBFisAQQQQAABBBBAAAEEEEAAAQQQQACBgRYgwBro6WFwCCCAAAIIIIAAAggggAACCCCAAAIEWKwBBBBAAAEEEEAAAQQQQAABBBBAAIGBFiDAGujpYXAIIIAAAggggAACCCCAAAIIIIAAAgRYrAEEEEAAAQQQQAABBBBAAAEEEEAAgYEWIMAa6OlhcAgggAACCCCAAAIIIIAAAggggAACBFisAQQQQAABBBBAAAEEEEAAAQQQQACBgRYgwBro6WFwCCCAAAIIIIAAAggggAACCCCAAAIEWKwBBBBAAAEEEEAAAQQQQAABBBBAAIGB
